                            return res.send({
                                status:false,
                                code:422,
                                type:'Unique error',
                                message:"Bu telefon nmrsi il artq restoran mvcuddur."
                            });
                        }
                    }).catch((err)=>{
                    return res.send({
                        status:false,
                        code:400,
                        type:'Undefined error',
                        message:err.message
                    });
