    });

const route=()=>{
    const router=new express.Router();
    router.route('/auth/edit').post((req, res) => {
        configs().findAll({
            limit:1,
            where:{
                id:1
            },
        }).then((configure)=>{
            if (req.headers.appkey!=configure[0].app_key){
                return res.send({
                    status:false,
                    code:401,
                    type:'Unauthorized error',
                    message:"Bel istfadi taplmad!"
