                let {name,id,address,voen,card,feedback}=req.body;
                const v = new Validator(req.body, {
                    name: 'required|string',
                    address: 'required|string',
                    voen: 'required|string',
                    feedback: 'string',
                    card: 'string',
                });
                v.check().then((matched) => {
                    if (!matched) {
                        return res.send({
                            status:false,
                            code:422,
                            type:'Validation error message',
                            message:v.errors
                        });
                    }
                }).catch((error)=>{
                    console.log(error)
                });


                restaurants().findAll({
                    where:{
                        voen:voen,
                        id:{[Op.ne]:id}
                    }
                })
                    .then((res3)=>{
                        if (res3.length>0){
                            return res.send({
                                status:false,
                                code:422,
                                type:'Unique error',
                                message:"Bu VEN il artq restoran mvcuddur."
                            });
                        }
                    }).catch((err)=>{
                    return res.send({
                        status:false,
                        code:400,
                        type:'Undefined error',
                        message:err.message
                    });
                });
                restaurants().findAll({
                    where:{
                        token:req.headers.token
                    }
                })
                    .then((res3)=>{
                        if (res3.length>0){
                        restaurants().update({name:name,voen:voen,address:address,card:card,feedback: feedback},
                            {
                                where:{
                                    id:id
                                }
                            })
                            .then(
                                (res2)=>{
                                    return res.send({
                                        status:true,
                                        code:200,
                                        type:'success',
                                        data:res2
                                    })
                                }
                            ).catch(
                            (err)=>{
                                return res.send({
                                    status:false,
                                    code:400,
                                    type:'Undefined error',
                                    message:err.message
                                });
                            })
                        }else {
                            return res.send({
                                status:false,
                                code:401,
                                type:'Unauthorized error',
                                message:"Bel istfadi taplmad!"
                            })
                        }

                    }).catch((err)=>{
                    return res.send({
                        status:false,
                        code:400,
                        type:'Undefined error',
                        message:err.message
                    });
                });

            }
        }).catch((err)=>{
            return res.send({
                status:false,
                code:400,
                type:'Undefined error',
                message:err.message
            });
        });
    });
    return router;
};

export default {
    route,
    routePrefix: `/${config.version}`
}
